import React, { useEffect, useMemo, useState } from "react";
import { FiSearch, FiUser } from "react-icons/fi";
import logo from "../../images/initial_logo.png";
import usPhoto from "../../images/us.jpg";
import "./Home.css";

export default function Home() {
  return (
      <main>
        <div
          className="home"
          style={{ backgroundImage: `url(${usPhoto})` }}
        >
          <div className="home-inner">
            <p className="home-kicker">We Are Getting Married</p>
            <h1 className="home-title">Dominic &amp; Anna</h1>
            <p className="home-copy">
              We are so excited to celebrate with you. Please RSVP when you can
              so we can plan accordingly.
            </p>
            <div className="home-cta">
                Will You Attend
            </div>
          </div>
        </div>
      </main>
  );
}
